    plt.rcParams["axes.labelweight"] = "bold"
    print(len(dual_load_total_bps_avg[cutdual:]))
    print(len(dual_thru_total_bps_avg[cutdual:]))
    print(len(dual_thru_total_bps_err[cutdual:]))
